  render: () => {
    const [file, setFile] = useState<File | null>(null);
    return <div className="w-[20rem]">
        <FileUpload file={file} onFileChange={setFile} title="Drag your file here..." description="JPEG or PNG, up to 50 MB" selectLabel="... or choose a file" removeLabel="Remove file" />
      </div>;
  }
